%[text] ## 姿勢計算50本ノック
%[text] ## 1-03 1-00で求めた主慣性軸方向を3次元空間に矢印でプロットせよ
clc
clear
close all
%%
%[text] ## 慣性テンソル
%[text] 対称行列であることに注意
J = [10 2 -3
    2 14 1
    -3 1 16];
%%
%[text] ## 主慣性モーメント
[v, d] = eig(J);

%[text] 慣性テンソルの対角化はテンソルの回転と等価なので固有ベクトル方向のプロットでok
v^(-1) * J * v % 一応確認
d

%[text] ## plot
%[text] `quiver3`を使う
figure %[output:9e493075]
quiver3(0, 0, 0, v(1,1), v(2,1), v(3,1), 'r') % quiver3便利 %[output:9e493075]
hold on % 重ねるのでhold on %[output:9e493075]
quiver3(0, 0, 0, v(1,2), v(2,2), v(3,2), 'g') %[output:9e493075]
quiver3(0, 0, 0, v(1,3), v(2,3), v(3,3), 'b') %[output:9e493075]
axis equal % aspect比を1:1:1に %[output:9e493075]

